export default function generateBasicUrl() {
    const apiSettings = require("../api-settings.json");
    
    var result = `${apiSettings.protocol}://${domain}:${port}/`;

    if(apiSettings.mainEndpoint)
        result = result.concat(apiSettings.mainEndpoint);

    return result;
}
